<ion-header [translucent]="true">
  <ion-toolbar>
    <ion-title>ajout-medecin</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true">
  <ion-header collapse="condense">
    <ion-toolbar>
      <ion-title size="large">ajout-medecin</ion-title>
    </ion-toolbar>
  </ion-header>
  <ion-item  class="entier">
    <ion-card *ngFor="let medecin of medecins1">
      <ion-card-header>
        {{ medecin.nom }} {{ medecin.prenom }}
      </ion-card-header>
      <ion-card-content>
        <p>Localisation: {{ medecin.etat }}</p>
        <p>Spécialité: {{ medecin.specialite }}</p>
      </ion-card-content>
    </ion-card>
  </ion-item>
  <ion-item>
    <ion-label position="stacked"><ion-icon name="location-outline"></ion-icon>&nbsp;État</ion-label>
    <ion-select [(ngModel)]="etat" name="etat">
      <ion-select-option *ngFor="let etat of etatsTunisiens" [value]="etat">{{ etat }}</ion-select-option>
    </ion-select>
  </ion-item>
    <ion-button  color="danger" (click)="fetchMedecins()"  >
      <ion-icon name="search-outline"></ion-icon>
    </ion-button>
  <ion-card *ngFor="let medecin of medecins">
    <ion-card-header>
      {{ medecin.nom }} {{ medecin.prenom }}
    </ion-card-header>
    <ion-card-content>
      <p>Localisation: {{ medecin.etat }}</p>
      <p>Spécialité: {{ medecin.specialite }}</p>
      <ion-button (click)="AddMedecinforpatient(medecin)" color="success">ajouter a mes medecin</ion-button>

    </ion-card-content>
  </ion-card>
</ion-content>
